package p1717

import (
	"fmt"
	"testing"
	"time"
)

func TestAnswer(t *testing.T) {

	testCases := []struct {
		name     string
		s        string
		x        int
		y        int
		expected int
	}{
		{
			name:     "Test Case 1",
			s:        "cdbcbbaaabab",
			x:        4,
			y:        5,
			expected: 19,
		},
		{
			name:     "Test Case 2",
			s:        "aabbaaxybbaabb",
			x:        5,
			y:        4,
			expected: 20,
		},
		{
			name:     "Test Case 3",
			s:        "",
			x:        4160,
			y:        8507,
			expected: 159586966,
		},
		{
			name:     "case 4",
			s:        "",
			x:        123,
			y:        3495,
			expected: 6150000,
		},
		{
			name:     "Test 5",
			s:        "",
			x:        4134,
			y:        8218,
			expected: 152014322,
		},
	}

	//
	for _, tc := range testCases {
		new := time.Now()
		t.Run(tc.name, func(t *testing.T) {
			output := maximumGain(tc.s, tc.x, tc.y)
			if output != tc.expected {
				t.Fatalf("expected: %v, output: %v", tc.expected, output)
			}
		})

		fmt.Println(time.Since(new))
	}
}
